function getCookie(a){for(var b=document.cookie.split("; "),c=0;c<b.length;c++){var d=b[c],e=d.indexOf("=");if(d.substring(0,e)==a)return d.substring(e+1)}return null}function setCookie(a,b,c){a=escape(a)+"="+escape(b||"")+";";if(c){b=new Date;b.setTime(b.getTime()+1E3*parseInt(c));a=a+" expires="+b.toGMTString()+";"}a+=" path=/;";return document.cookie=a}function deleteCookie(a){return setCookie(a,null,-86400)}
